import React from "react"
import {MemberConsumer} from"./Context";
import {NavLink} from "react-router-dom";
import {ButtonContainer} from "./Button"
import Title from "./Title"
import styled from 'styled-components';

function CVCourses () {
    return (
      <MemberConsumer>
      	{value  =>{
      const {id, name, img, about,profession, location, inNetwork}=
      value.MemberDetail;
      return(
      <div>
      <h2>User profile</h2>

        {/* "+" button adds user to personal network of mentees. If added then toggle to "-"		
 			*/}
        <h2>add member</h2>
        <p>menteepower</p>
        <p>mentorpower</p>
        <p>available MNT</p>
        <p>staked MNT</p>
        <p>total MNT</p>


      	<div className="container py-5">

      	{/* name */}
      	<div className="row">
      	<div className="col-10 mx-auto text-center text-slanted text-black my-5">
      	<h1>{name}</h1>
      </div>
      </div>
      {/* end name */}
    	{/* member info */}

       <MyContainer>
       <div className="col-10 mx-auto col-md-6 my-3 ">
       	<img src={img} className="img-fluid" style={{width: "30rem", height: "30rem"}} alt="member"/>
       	<div class="button my-3" ><NavLink to="/MyNetworkMentees">MY NETWORK</NavLink></div>

       	</div>
       </MyContainer>

       	 {/* about member text */}
       	 <span className="container-fluid my-3">
       	 	<h2>About me:</h2>
       	 	<h4 className="text-title text-uppercase text-muted mt-3 mb-2"></h4>
       		<p className="text-muted lead">{about}</p>
       			<div>
		<NavLink to="/Members">
			<ButtonContainer>back to members</ButtonContainer>
		</NavLink>
			<ButtonContainer MyNetworkMentees
				disabled={inNetwork? true:false}
					onClick={() => {
					value.addMember(id);
					value.openModal(id);
					}}
					>
					{inNetwork? "in Network" : "add to network"}
					</ButtonContainer>


      <div class="container">

      	<h3>Account activity timeline</h3>  
      	<h3>Blockchain CV</h3> 
      	<ul class="nav nav-pills mb-3" id="pills-tab" role="tablist">
  <li class="nav-item">
    <a class="nav-link active" id="pills-home-tab" data-toggle="pill" href="#Details" role="tab" aria-controls="pills-home" aria-selected="true">Home</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" id="pills-profile-tab" data-toggle="pill" href="#CVCourses" role="tab" aria-controls="pills-profile" aria-selected="false">Profile</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" id="pills-contact-tab" data-toggle="pill" href="#pills-contact" role="tab" aria-controls="pills-contact" aria-selected="false">Contact</a>
  </li>
</ul>
<div class="tab-content" id="pills-tabContent">
  <div class="tab-pane fade show active" id="pills-home" role="tabpanel" aria-labelledby="pills-home-tab">...</div>
  <div class="tab-pane fade" id="pills-profile" role="tabpanel" aria-labelledby="pills-profile-tab">...</div>
  <div class="tab-pane fade" id="pills-contact" role="tabpanel" aria-labelledby="pills-contact-tab">...</div>
</div>  


 		<ul>
 		<li>Experience</li>
 		<li>Skills</li>
 		<li>Education</li>
 		</ul>
 		</div>>

 		</div>
 		</span>
       		</div>
       	 </div>
      );
      }}

      </MemberConsumer>



    )
  }










export default CVCourses

const MyContainer = styled.div`
$(function () {
    $('#pills-tab li:last-child a').tab('show')
  })
$('#pills-tab').tab('show')
img{
	border-radius:50%;

}

.button{
	margin: 0 auto

}
`
